import React from 'react';
import github from '../assets/icons/github.png'
import ruby from '../assets/icons/ruby.jpeg'

const ProjectCard = ({ projet: { name, image, deployed_url, github_url } }) => {
    return (
        <div className="projectCard col-md-6 col-lg-4 my-2">
            <figure className="projectCard__wrapper">
                <a href={deployed_url} target="_blank" rel="noopener noreferrer" >
                    <img src={image} alt={name}  className="projectCard__image" />
                </a>
                <div className="projectCard__title">
                    <a href={github_url} target="_blank" rel="noopener noreferrer" >
                        <img src={github} alt="github link" className="projectCard__icon" />
                    </a>
                    {name}

                </div>
            </figure>

        </div >
    );
};

export default ProjectCard;
